import React, { Component } from 'react'
import { borderColor } from '@material-ui/system';

export default class login extends Component {

    render() {

        const style = {
            fontSize: '20px',
            borderColor: 'black',
            borderStyle: 'solid',
            margin: '10px'
          };

        return (
            <div className='container text-center'>
                <div style={style}><a href='http://localhost:8080/api/auth/logout'>Logout</a></div>
                <div style={style}><a href='http://localhost:8080/api/auth/login'>Login</a></div>
                <div style={style}><a href='http://localhost:8080/api/auth/login'>Login with Google</a></div>
            </div>
        )
    }
}
